//SPDX-License-Identifier:MIT
pragma solidity 0.8.6;


contract forLoop{

int x=0;
int[] data ;
 function output() public returns (int[] memory)
{
    int k;
 for (x=0;x<k;x++)
 {
data.push(x);
 }

 return data; 
} 


}

